import '../../styles/Footer.css';

function Footer() {
    return (
        <footer className="row mt-5 text-center bg-purple">
            <span className="col-5"></span>
            <button className="col-2">Changer de mode</button>
            <span className="col-5"></span>
        </footer>
    )
}

export default Footer;
